import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route }  from 'react-router-dom';
import Home from './components/home';
import Profile from './components/profile';
import Details from './components/details'
import { CardContent } from './components/data';
import Payment from './components/payment'
import ListTransaction from './components/list-transaction'
// import NavHeader from './components/navbar';
import PaymentApprove from './components/payment-approve';
import IncomeTrip from './components/income-trip';
import AddTrip from './components/add-trip';
import PrivateRoute from './components/privateRoute';



function App() {
  const Data = CardContent()
  const storage = localStorage.getItem("name")

  const storageUser = localStorage.get("user")
  console.log(storageUser);
  // // console.log(storage)
  // const [isLogin, setLogin] = useState(false);
  return (
    <>
    <Router>
    <Routes>
      <Route exact path="/" element={<Home/>} />
      <Route exact path="/details/:id" element={<Details data={Data}/>} />a
      {/* <Route exact path="/navbar" element={}/> */}
      {/* <Route exact pasth="/signin" elemen={<Signin islogin={isLogin} setlogin={setLogin}/>} /> */}

      <Route element={<PrivateRoute login={storage}/>} >
        <Route exact path="/payment/:id" element={<Payment data={Data}/>} />
        <Route exact path="/payment-approve/:id" element={<PaymentApprove data={Data}/>} />
        <Route exact path="/profiles" element={<Profile/>} />
        <Route exact path="/list-transaction" element={<ListTransaction />} />
        <Route exact path="/income-trip" element={<IncomeTrip />} />
        <Route exact path="/add-trip" element={<AddTrip />} />
      </Route>
    </Routes>
    </Router>
    </>
  );
}

export default App;
